import { Box } from "@mui/material";

const QualityIcon = ({ quality, ico }) => {
    return (
        <Box
            width={"150px"}
            maxWidth={"150px"}
            display="flex"
            flexDirection="column"
            alignItems="center"
            border="1px solid black"
        >
            {ico}
            <h3
                style={{
                    margin: '0.5rem',
                    fontSize: '1.5rem',
                    fontWeight: '200'
                }}
            >{quality}</h3>
        </Box>
    );
}

export default QualityIcon;
